import React from "react";

const Card = ({image, name, weight, temperament})=>{

return(
  <div>
   <img src={image} alt={name} />
    <h2>{name}</h2>
    <h4>{weight}</h4>
    <h4>{temperament}</h4>
    Hola
  </div>
)
}

export default Card;
